-- ----------------------------
-- Function structure for currval
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS bigint(20)
BEGIN

DECLARE
VALUE
	BIGINT ; SELECT
		current_value INTO
	VALUE

	FROM
		my_sequence
	WHERE
		upper(NAME) = upper(seq_name) ; -- 大小写不区分.
		RETURN
	VALUE
		;
	END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS bigint(20)
BEGIN

DECLARE
VALUE
	BIGINT ; UPDATE my_sequence
SET current_value = current_value + increment
WHERE
	upper(NAME) = upper(seq_name) ; RETURN currval (seq_name) ;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for setval
-- ----------------------------
DROP FUNCTION IF EXISTS `setval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `setval`(
	seq_name VARCHAR (50),VALUE BIGINT
) RETURNS bigint(20)
BEGIN
	UPDATE my_sequence
	SET current_value = VALUE
WHERE
	upper(NAME) = upper(seq_name) ; RETURN currval (seq_name) ;
END
;;
DELIMITER ;
